import './App.css';
import Navbar from "./navbar"

function App() {
  let Component 
  switch (window.location.pathname){
    case "/":
      component = App
      break
      case "/products":
        component = Products
        break
        case "/contact-us":
          component = Contact-Us
          break
  }
  return <Navbar />

}

export default App;
